                      </div>
                      <div className="form-group">
                      <label>
                             Password
                          </label>
                          <input onChange={(e)=>setPassword(e.target.value)} type="password" placeholder="Enter password" className="form-control" name="password"/>
                      </div>
                     
                      <div className="form-group">
                          <input type="button" onClick={validate} value="Next" className="form-control signup btn btn-primary"/>
                      </div>
                    </form>
                 </div>
                </div> 
                </Row> 
             </div>
        </Container>
                           
                   
    )
}

